var title_f8_43_8887="PCP x-ray and BAL";
var content_f8_43_8887=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F88410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F88410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 475px\">",
"   <div class=\"ttl\">",
"    Radiographic and bronchoalveolar lavage features of PCP",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 455px; height: 575px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with AIDS who develop PCP typically present with a cough, fever, and exertional dyspnea. A chest x-ray (Panel A) characteristically has interstitial and alveolar infiltrates in a perihilar distribution. In AIDS patients, BAL demonstrates the associated inflammatory cell burden, rich in lymphocytes (CD8",
"    <sup>",
"     +",
"    </sup>",
"    T cells) and macrophages, with a relative paucity of neutrophils (see the Wright-Giemsa stained smear in Panel B). A methenamine silver stained smear of BAL fluid from patients with AIDS (Panel C) reveals abundant numbers of Pneumocystis cyst forms. In immunocompromised patients without AIDS, PCP has a more fulminant onset and can rapidly progress to respiratory failure. The chest x-ray from such patients (Panel D) usually has diffuse lung infiltrates in a pattern that is consistent with severe lung injury, whereas the BAL fluid (see the Wright-Giemsa stained smear in Panel E) has an abundance of inflammatory cells, particularly neutrophils. A methenamine silver stain of the BAL fluid (Panel F) again demonstrates cyst forms, although usually significantly fewer than in patients with AIDS (compare with Panel C).",
"    <div class=\"footnotes\">",
"     PCP:",
"     <em>",
"      Pneumocystis",
"     </em>",
"     pneumonia; BAL: bronchoalveolar lavage.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with&nbsp;permission from Macmillan Publishers Ltd: Nature Reviews Microbiology. Thomas CF Jr, Limper AH. Current insights into the biology and pathogenesis of Pneumocystis pneumonia. Nat Rev Microbiol 2007; 5:298. Copyright &copy; 2007.",
"     <a href=\"file://www.nature.com/nrmicro\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"      www.nature.com/nrmicro",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
