"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral formulations may be taken with food to decrease GI distress. Food may reduce effectiveness of oral solution. Some products may contain phenylalanine.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Diclofenac potassium = Cataflam&reg;; potassium content: 5.8 mg (0.15 mEq) per 50 mg tablet",
"    </p>",
