" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Selected genetic syndromes associated with obesity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"20%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Syndrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Locus",
"       </td>",
"       <td class=\"subtitle1\">",
"        Gene",
"       </td>",
"       <td class=\"subtitle1\">",
"        Obesity onset (type)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Albright hereditary osteodystrophy (Pseudohypoparathyroidism type 1a) (MIM #103580)",
"       </td>",
"       <td>",
"        20q13.2",
"       </td>",
"       <td>",
"        GNAS1",
"       </td>",
"       <td>",
"        Early (generalized)",
"       </td>",
"       <td>",
"        Short stature, short metacarpals and metatarsals, round facies, delayed dentition, +/&minus; hypocalcemia and/or subcutaneous calcium or bone deposition(osteoma cutis), precocious puberty, mild cognitive deficit",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Alstr&ouml;m (MIM #203800)",
"       </td>",
"       <td>",
"        2p13",
"       </td>",
"       <td>",
"        ALMS1",
"       </td>",
"       <td>",
"        Age 2-5 yrs (central)",
"       </td>",
"       <td>",
"        Blindness, deafness, acanthosis nigricans, chronic nephropathy, type 2 diabetes, cirrhosis, primary hypogonadims in males only, normal cognition",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"15\">",
"        Bardet-Biedl (MIM #209900)",
"       </td>",
"       <td>",
"        11q13",
"       </td>",
"       <td>",
"        BBS1",
"       </td>",
"       <td rowspan=\"15\">",
"        Age 1-2 yrs (central)",
"       </td>",
"       <td rowspan=\"15\">",
"        Mental retardation, hypotonia, retinitis pigmentosa, polydactyly, hypogonadism +/&minus; glucose intolerance, deafness, renal disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        16q21",
"       </td>",
"       <td>",
"        BBS2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3p12-q13",
"       </td>",
"       <td>",
"        BBS3 (ARL6)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        15q22.3-q23",
"       </td>",
"       <td>",
"        BBS4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2q31",
"       </td>",
"       <td>",
"        BBS5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        20p12",
"       </td>",
"       <td>",
"        BBS6 (MKKS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4q27",
"       </td>",
"       <td>",
"        BBS7",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        14q32",
"       </td>",
"       <td>",
"        BBS8 (TTC8)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7p14",
"       </td>",
"       <td>",
"        BBS9",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        12q",
"       </td>",
"       <td>",
"        BBS10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        9q33.1",
"       </td>",
"       <td>",
"        BBS11 (TRIM32)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4q27",
"       </td>",
"       <td>",
"        BBS12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        17q23",
"       </td>",
"       <td>",
"        BBS13 (MKS1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        12q21.3",
"       </td>",
"       <td>",
"        BBS14 (CEP290)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2p15",
"       </td>",
"       <td>",
"        BBS15 (C2ORF86)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Beckwith-Wiedemann (MIM #130650)",
"       </td>",
"       <td>",
"        11p15.5 in most cases; deregulation of imprinted genes including IGF2",
"       </td>",
"       <td>",
"        multiple",
"       </td>",
"       <td>",
"        &minus;",
"       </td>",
"       <td>",
"        Hyperinsulinemia, hypoglycemia, hemihypertrophy, intolerance of fasting",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Carpenter (MIM #201000)",
"       </td>",
"       <td>",
"        6p11",
"       </td>",
"       <td>",
"        RAB23",
"       </td>",
"       <td>",
"        (central)",
"       </td>",
"       <td>",
"        Mental retardation, short stature, brachycephaly, polydactyly, syndactyly of feet, cryptorchidism, umbilical hernia, high-arched palate, hypogonadism in males only",
